import React from "react";
import "antd/dist/antd.css";
import { BrowserRouter } from "react-router-dom";
import { useRoutes } from "./routes";

function App() {
  const routes = useRoutes(false);
  return <BrowserRouter>{routes}</BrowserRouter>;
}

export default App;
